import React from 'react';
import classes from './PartnersList.module.css';
import Wrapper from '../UI/WrapperNoColor';

import { Grid } from '@mui/material';

import nvidia from "../../assets/partners/Nvidia2.jpg";
import cyberport from"../../assets/partners/Cyberport.png";
import bigdata from "../../assets/partners/BigData2.png";
import cifaalh from "../../assets/partners/Cifaal.png";
import deeptech from "../../assets/partners/dt.png";
import ldeos from "../../assets/partners/Ldeos.png";
import runjie from "../../assets/partners/Runjie.png";
import menta from "../../assets/partners/Menta2.png";
import sztu from "../../assets/partners/SHTU.jpg";
import lingma from "../../assets/partners/lingma.png"
import dba from "../../assets/partners/dba.png"
import itu from "../../assets/partners/itu.png"

const PartnersList = () => {
  return (
    <Wrapper>
      <div className={classes.title}>
        <h2>BUSINESS PARTNERS</h2>
        <div className={classes["title-underline"]} />
      </div>
      <div className={classes.gallery}>
        <div className={classes["gallery-category"]}>
          <h3>Business Partners</h3>
          <p>These are healthcare companies that are not equity owners. They provide “underwriting” or “sponsorship” financial support for the cost of operating the Lab. These companies will have various benefits based on the level of financial support they provide to the Innovation Lab.</p>
          <Grid item md={12} container spacing={2} sx={{marginTop: "2%", marginBottom: "2%"}}>
            <Grid item xs={12} md={3} 
              sx={{
                textAlign: "center",
                marginBottom: "2%"
                }}>
              <img src={nvidia} alt="Nvidia logo" className={classes.logo}/>
            </Grid>
            <Grid item xs={12} md={3} 
              sx={{
                textAlign: "center",
                marginBottom: "2%"
                }}>
              <img src={cyberport} alt="Cyberport logo" className={classes.logo}/>
            </Grid>
            <Grid item xs={12} md={3} 
              sx={{
                textAlign: "center",
                marginBottom: "2%"
                }}>
              <img src={itu} alt="Indian Technical university logo" className={classes.logo} style={{width: "50%"}}/>
            </Grid>
            <Grid item xs={12} md={3} 
              sx={{
                textAlign: "center",
                marginBottom: "2%"
                }}>
              <img src={runjie} alt="Runjie logo" className={classes.logo}/>
            </Grid>`
          </Grid>
          <div className={classes.divider} />
        </div>
        <div className={classes["gallery-category"]}>
          <h3>Alliance Partners</h3>
          <p>The Innovation Institute has several alliance partners.</p>
          <Grid item md={12} container spacing={2} sx={{marginTop: "2%", marginBottom: "2%"}}>
            <Grid item xs={12} md={3} 
              sx={{
                textAlign: "center",
                marginBottom: "2%"
                }}>
              <img src={cyberport} alt="Cyberport logo" className={classes.logo}/>
            </Grid>
            <Grid item xs={12} md={3} 
              sx={{
                textAlign: "center",
                marginBottom: "2%"
                }}>
              <img src={itu} alt="Indian Technical university logo" className={classes.logo} style={{width: "50%"}}/>
            </Grid>
            <Grid item xs={12} md={3} 
              sx={{
                textAlign: "center",
                marginBottom: "2%"
                }}>
              <img src={runjie} alt="Runjie logo" className={classes.logo}/>
            </Grid>`
          </Grid>
          <div className={classes.divider} />
        </div>
        <div className={classes["gallery-category"]}>
          <h3>Affiliation Partners</h3>
          <Grid item md={12} container spacing={2} sx={{marginTop: "2%", marginBottom: "2%"}}>
            <Grid item xs={12} md={3} 
              sx={{
                textAlign: "center",
                marginBottom: "2%"
                }}>
              <img src={bigdata} alt="Nvidia logo" className={classes.logo}/>
            </Grid>
            <Grid item xs={12} md={3} 
              sx={{
                textAlign: "center",
                marginBottom: "2%"
                }}>
              <img src={sztu} alt="Cyberport logo" className={classes.logo}/>
            </Grid>
            <Grid item xs={12} md={3} 
              sx={{
                textAlign: "center",
                marginBottom: "2%"
                }}>
              <img src={deeptech} alt="Indian Technical university logo" className={classes.logo} style={{width: "50%"}}/>
            </Grid>
          </Grid>
        </div>
      </div>
    </Wrapper>
  )
};

export default PartnersList;
